$(document).ready(function(){var t=$("#product-template").html(),o=$("#cart-template").html(),r=Handlebars.compile(t),c=Handlebars.compile(o);$.ajax("/products").done(function(t){$("#product-listing").html(r({products:t}))}).fail(function(){console.log("error-cart")}),$.ajax("/cart_order").done(function(t){$("#product-cart").html(c({cart_order:t}))}).fail(function(){console.log("error-cart")})});